    false,nt"url": null,nt"notes": "The NWHI lobster trap fishery, which commenced
    in the mid-1970s, is a multispecies fishery and primarily targets the Hawaiian spiny
    lobster (Panuliris marginatus) and the common slipper lobster (Scyllarides squammosus).
     The ridgeback slipper lobster (S. haani) became a target species later in the
    fishery as the live market opened up.  The green spiny lobster (P. penicillatus)
    and the chinese slipper lobster (Parribacus antarcticus) were incidental catches
    made in very low abundances.  Fishery statistics during the early developmental
    phase of the fishery (1976-82), prior to the establishment of the Crustaceans FMP,
    are scant. Also, despite significant changes in trap configuration during the 1980s,
    information identifying the type of trap fished is not available.  Octopus were
    one of the incidental catch species that were retained by some vessels.nnThe fishery
    started out as a frozen tail fishery.  Towards the end of the fishery the vessels
    were returning with live spiny and slipper lobsters.  Majority of the live lobsters
    were destined for non-US markets.  The frozen tails were marketed world wide.  ",nt"license_title":
